column13:
A padlock (1) is provided with 
(a) a lock body (2); 
(b) a shackle (9) releasably lockable to the body in a closed position defining a closed space (10) between the shackle and the body for securing to an object, and movable to an open position for receiving and releasing the object between the shackle and the body; and 
(c) a key-operable lock (18) having a rotatable lock cylinder (21) housed in the lock body and operatively connected to the shackle by a drive linkage, the drive linkage comprising: 
(i) cam gear teeth (26) rotatable with the lock-cylinder; 
(ii) a gear rack operatively engaged with the cam gear teeth and releasably attachable to the shackle for rotation therewith; 
wherein upon rotation of the lock cylinder, the cam gear teeth move the gear rack which moves the shackle from the closed to the open position.

A method for transferring execution from a first computer instruction stream to a second computer instruction stream, comprising: 
profiling the first computer instruction stream, wherein the profiling includes recording details of the execution flow of the first computer instruction stream to create a profile of the first computer instruction stream; 
analyzing the profile of the first computer instruction stream to identify a frequently executed section; 
translating the frequently executed section of the first computer instruction stream into the second computer instruction stream; 
monitoring execution of the first computer instruction stream to determine when execution has reached the frequently executed section; 
transferring execution from the first computer instruction stream to the second computer instruction stream to execute the frequently executed section; and 
returning execution to the first computer instruction stream when execution of the frequently executed section is complete.
